import Rotas from './Rotas';

import { BrowserRouter } from 'react-router-dom';

import  { Container } from 'react-bootstrap';


import {lazy,Suspense} from 'react';

const  Menu = lazy(() => import("./Componentes/Menu"));
const  Card = lazy(() => import('./Componentes/card'));
const  Footer = lazy(() => import('./Componentes/Footer'));




function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <header>
        <Suspense fallback={<div> Carregando....</div>}>
            <Menu />
          </Suspense>
        </header>
        <main>
          <Container fluid>
              <Rotas />
          </Container>
        </main>
        <footer>
        <Suspense fallback={<div> Carregando....</div>}>
          <Footer />
        </Suspense>
        </footer>
      </div>
    </BrowserRouter>
  );
}

export default App;
